        protected override void RunSearch()
        {
            if (edtUebersichtFaelle.Checked)
            {
                memoFaelligkeitmeldung.DataMember = null;
                memoFaelligkeitmeldung.Visible = false;
                lblFaelligkeitmeldung.Visible = false;
                ctlGotoFall.DataMember = null;
                ctlGotoFall.Visible = false;
                xDocument.Visible = false;
                lblLimitDatensaetze.Visible = false;
                grdQuery1.Height = tpgListe.Height - 10;
            }
            else
            {
                memoFaelligkeitmeldung.DataMember = "Fälligkeitsmeldung";
                memoFaelligkeitmeldung.Visible = true;
                lblFaelligkeitmeldung.Visible = true;
                ctlGotoFall.DataMember = "KlientensystemID$";
                ctlGotoFall.Visible = true;
                xDocument.Visible = true;
                lblLimitDatensaetze.Visible = true;
                grdQuery1.Height = tpgListe.Height - 115;

                string Codes = "," + Utils.ConvertToString(edtSucheFaProzessCodes.EditValue) + ",";
                if (Codes.Contains(",4024,") && !(Codes.Contains(",4020,") || Codes.Contains(",4040,")))
                {
                    KissMsg.ShowInfo("Mindestens eines Leistungstyp muss ausgewählt sein:\r\n" +
                    "- A - Anspruchsberechnung ALBV / ÜbH\r\n" +
                    "- A - Anspruchsberechnung KKBB");
                    throw new Exception();
                }

                if (DBUtil.IsEmpty(edtSucheFaProzessCodes.EditValue))
                {
                    KissMsg.ShowInfo("Mindestens ein Leistungstyp muss ausgewählt sein.");
                    throw new Exception();
                }

                if (DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheGruppe.EditValue) &&
                    DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheTeam.EditValue) &&
                    DBUtil.IsEmpty(ctlOrgUnitTeamUser.SucheUserID.EditValue))
                {
                    KissMsg.ShowInfo("Mindestens eines der folgenden Felder muss ausgefüllt werden:\r\n\r\n" +
                        "- Organisationsgruppe\r\n" +
                        "- Team\r\n" +
                        "- Mitarbeitende\r\n");
                    throw new Exception();
                }
            }
            base.RunSearch();
        }

